import React from "react";
import Dialog from "./Dialog";

export default function Login() {
  return (
    <div style={{ position: "relative" }}>
      <div
        style={{
          backgroundColor: "green",
          height: "185px",
          width: "100%",
          position: "absolute",
          zIndex: "-5",
        }}
      ></div>
      <div style={{ marginTop: "185px", overflow: "hidden" }}></div>
      <Dialog />
    </div>
  );
}
